import React, { useEffect, useState } from 'react'
import { Route, Navigate } from 'react-router-dom';
import Cookies from 'js-cookie';
import axios from 'axios';
import GetPlaylist from '../features/GetPlaylist';
import ShowSong from '../features/ShowSong';
import ShowPlaylist from '../features/ShowPlaylist';
export default function Extraxt() {

    const sessionId = Cookies.get('sessionId');
    const [user, setUser] = useState(null);
    const [isLoggedIn, setisLoggedIn] = useState(false);
    const [email, setemail] = useState('');

    useEffect(() => {

        const fetchUserData = async () => {

            if (sessionId) {
                try {
                    const response = await axios.get('http://localhost:5000/api/getuser', {
                        params: { sessionId: sessionId }
                    });
                    setUser(response.data);
                    setisLoggedIn(true);
                    console.log("called");
                } catch (error) {
                    console.log(error);
                }

            }

        }
        fetchUserData();

    }, [])

    useEffect(() => {
        setemail(user?.email || '');
    }, [user])

    return (
        <div>
            {sessionId ? (
                <>
                    <h1>Welcome to spotyt</h1>
                    ShowPlaylist />
                    {email != '' ? <GetPlaylist email={email} /> : null}
                    {email != '' ? <ShowSong email={email} /> : null}

                </>
            ) : (
                <Navigate to="/login" />
            )}
        </div>
    )
}
